public class LCS_LENGTH {
    public static Integer lcs_length(String s, String t) {
        // make a Counter
        Map<Integer, Map<Integer,Integer>> dp = new HashMap<Integer,Map<Integer,Integer>>();

        // just set all the internal maps to 0
        for (int i=0; i <= s.length(); i++) { // change < to <=
            Map<Integer,Integer> initialize = new HashMap<Integer,Integer>();
            dp.put(i, initialize);
            for (int j=0; j <= t.length(); j++) { // change < to <=
                Map<Integer,Integer> internal_map = dp.get(i);
                internal_map.put(j,0);
                dp.put(i, internal_map);
            }
        }

        // now the actual code
        for (int i=1; i <= s.length(); i++) { // change 0 to 1
            for (int j=1; j <= t.length(); j++) { // change 0 to 1
                if (s.charAt(i-1) == t.charAt(j-1)) { // change s.charAt(i) to s.charAt(i-1)
                    if (dp.containsKey(i-1)) {
                        Map<Integer, Integer> internal_map = dp.get(i);
                        int insert_value = dp.get(i-1).get(j-1) + 1; // change dp.get(i-1).get(j) to dp.get(i-1).get(j-1)
                        internal_map.put(j, insert_value);
                        dp.put(i,internal_map);
                    } else {
                        Map<Integer, Integer> internal_map = dp.get(i);
                        internal_map.put(j,1);
                        dp.put(i,internal_map);
                    }
                }
            }
        }

        if (!dp.isEmpty()) {
            List<Integer> ret_list = new ArrayList<Integer>();
            for (int i=0; i<=s.length(); i++) { // change < to <=
                ret_list.add(!dp.get(i).isEmpty() ? Collections.max(dp.get(i).values()) : 0);
            }
            return Collections.max(ret_list);
        } else {
            return 0;
        }
    }
}

